    false,nt"url": null,nt"notes": "These data are summary statistics of abundances
    of birds counted within 100-m radius circles with 10-minute point counts at multiple
    sample points along 36 randomly selected watercourses in the foothills of the Sierra
    Nevada Mountain Range. Bird surveys were conducted between 25 March 2005 and 30
    June 2005 along watercourses from Butte to Calaveras counties. These data represent
    2,614 detections of 94 species at 144 different sample points along the 36 watercourses.",nt"license_title":
